import React from 'react';

class User extends React.Component {
  render()
    {
      return (
        <div className="wrapper__vk__border">
          <form onSubmit={this.props.userMethod} className="wrapper__vk__border__form">
            <input type="text" name="id" />
            <button>Получить информацию</button>
          </form>
          <div>
            <div className="wrapper__vk__border__image">
              <img src={this.props.photo} alt=""/>
            </div>
            <div className="wrapper__vk__border__id">ID страницы: {this.props.id}</div>
            <div className="wrapper__vk__border__firstName">Имя: {this.props.firstName}</div>
            <div className="wrapper__vk__border__lastName">Фамилия: {this.props.lastName}</div>
            <div className="wrapper__vk__border__date">Дата рождения: {this.props.bdate}</div>
            <div className="wrapper__vk__border__sex">
              {this.props.sex===2 && <div>Пол: мужской</div>}
              {this.props.sex===1 && <div>Пол: женский</div>}
              {this.props.sex===0 && <div>Пол: не указан</div>}
            </div>
          </div>
        </div>
      )
    }
}

export default User
